import { Button } from 'bootstrap';
import React from 'react';
import "./Header1.css";

const Header1 = (props) => {
  return (
    <div className="header1">
      <div className="leftSide">
        <div className="links">
          <a href="#">Home</a>
          <a href="#">Html</a>
          <a href="#">Css</a>
          <a href="#">JavaScript</a>
          <a href="#">Java</a>
          <a href="#">Android</a>

        </div>

      </div>
      <div className="rightSide">
        <input type="text" placeholder="Search..." />
        <button>Search</button>
      </div>
    </div>
  );
}

export default Header1;
